import React from "react";
import * as Font from "expo-font";
import { useFonts } from "@use-expo/font";

import { NavigationContainer } from "@react-navigation/native";
import { createNativeStackNavigator } from "@react-navigation/native-stack";

import HomeScreen from "./app/screens/HomeScreen";
import DetailsScreen from "./app/screens/DetailsScreen";
import AppLoading from "expo-app-loading";

const Stack = createNativeStackNavigator();
const StackNavigator = () => (
	<Stack.Navigator
		screenOptions={{
			headerStyle: { backgroundColor: "rebeccapurple" },
			headerTintColor: "white",
		}}
	>
		<Stack.Screen name="Home" component={HomeScreen} />
		<Stack.Screen name="Details" component={DetailsScreen} />
	</Stack.Navigator>
);

// require in the font
const customFonts = {
	// Montserrat: require("./assets/fonts/montserrat.ttf"),
	"alfa-slab-one": require("./app/assets/fonts/AlfaSlabOne-Regular.ttf"),
	"bowlby-one-sc": require("./app/assets/fonts/BowlbyOneSC-Regular.ttf"),
};

export default function App() {
	// the same as Font.loadAsync , the hook returns  true | error
	const [isLoaded] = useFonts(customFonts);

	if (!isLoaded) {
		return <AppLoading />;
	}
	// from the custom App we return the component we assigned to RootApp.
	return (
		<NavigationContainer>
			<StackNavigator />
		</NavigationContainer>
	);
}
